function Counter() {
  $(".counter .numberic").each(function () {
    $(this)
      .prop("Counter", 0)
      .animate(
        { Counter: $(this).text() },
        {
          duration: 6e3,
          easing: "swing",
          step: function (t) {
            $(this).text(
              Math.ceil(t)
                .toString()
                .replace(/(\d)(?=(\d\d\d)+(?!\d))/g, "$1.")
            );
          },
        }
      );
  });
}
function hoverButton() {
  let t;
  $(".biz-effect .text").each(function () {
    (t = $(this)),
      (t[0].innerHTML =
        "<span class='inner-text'><span>" +
        t[0].textContent.trim().split(" ").join("</span><span>") +
        "</span>");
  });
}
function lazyImages() {
  let t;
  "IntersectionObserver" in window ||
    (((t = document.createElement("script")).src =
      "https://raw.githubusercontent.com/w3c/IntersectionObserver/master/polyfill/intersection-observer.js"),
    document.getElementsByTagName("body")[0].appendChild(t)),
    lozad().observe();
}
function niceSelectInit(t, holder) {
  if ($("#" + t).length) {
    let $placeholder = holder ? holder : "Select an option";
    let e = NiceSelect.bind(document.getElementById(t), {
        searchable: !1,
        placeholder: $placeholder,
      }),
      n = $(e.el).parents(".form-group").find(".label-text"),
      i = $(e.el).parents(".form-group").find(".nice-select");
    0 != e.el.value
      ? (i.addClass("have-text"), n.addClass("have-text"))
      : (n.removeClass("have-text"), i.removeClass("have-text")),
      $(e.el).on("change", function () {
        i.addClass("have-text"),
          n.addClass("have-text"),
          0 == e.el.value &&
            (n.removeClass("have-text"), i.removeClass("have-text"));
      });
  }
}
